import React from "react";
import BlackRec from "./BlackRec";
import "../styles/Section4.css";

const t1 = [
  "I can’t recommend this podcast enough",
  "Jacob is the best in the business",
  "A wealth of audio knowledge",
  "Every episode is a gem!",
  "Whoa whoa, let me take some notes!",
  "Whoa whoa, let me take some notes!",
];
const t2 = [
  "Betty Lacey",
  "Adam Driver",
  "Marcus Brown",
  "Jessica Knowl",
  "Scott Adams",
  "Steven Blast",
];

const Section4 = () => {
  return (
    <section className="Section4">
      <div>
        <BlackRec text1={t1[0]} text2={t2[0]} />
        <BlackRec />
        <BlackRec />
      </div>
      <div>
        <BlackRec />
        <BlackRec />
        <BlackRec />
      </div>
    </section>
  );
};

export default Section4;
